import React from 'react';
import './App.scss';
import Experiences from './components/Experiences'; // Adjusted path for Experiences component

const App: React.FC = () => {
  // Assuming you have Image1.jpg, Image2.jpg, etc., in your Images folder
  const imageList = [
    { src: './images/image1.jpg', alt: 'Description of Image 1' },
    { src: './images/image2.jpg', alt: 'Description of Image 2' },
    // Add more images as needed
  ];

  return (
    <div className="App">
      <header className="App-header">
        <div className="container">
          <div className="navigation-bar">
            <img src="./Images/logo.svg" alt="Logo" className="logo" />
            <button className="button">GET IN TOUCH</button>
          </div>
        </div>
      </header>
      <main className="main">
        <h1 style={{ fontSize: '30px', fontFamily: 'Amiri, sans-serif', color: '#333333', fontWeight: 'normal' }}>
          Hi there, I'm Nilay. Put simply, I love building things.
        </h1>
        <h2 style={{ fontWeight: 'bold', fontFamily: 'Amiri, sans-serif', fontSize: '30px' }}>
          Here's (most of) my work so far.
        </h2>
      </main>
      <div className="selected-work">
        <h2>SELECTED WORK</h2>
      </div>
      <Experiences images={imageList} />
    </div>
  );
}

export default App;
